import React from "react";
import axios from 'axios'
import { useState } from 'react';
import { useEffect } from 'react';
import '../css/bookSearch.css';
import Noimage from '../image/noImage.png';

const Result = () =>{
    const [posts, setPosts] = useState([]);

    useEffect(()=>{
        axios.get('https://www.googleapis.com/books/v1/volumes?q=java&maxResults=6')
        .then(res =>{
            setPosts(res.data)
        })
    },[])

    return(
        <section id="pickup">
        <div>
            <h2>検索結果</h2>   
            <div id="pickupcontens">
                <ul>
                    <li>
                        <img src={Noimage} alt="画像"/>
                        <h3 id="content-title">タイトルタイトル</h3>
                        <p>テキストテキストテキスト</p>    
                    </li>
                    {
                        posts.map((post) =>
                        <li key={post.id}> 
                        {post.volumeInfo.title} 
                        </li>
                        )
                    }   
                    </ul>
            </div>
            </div>
    </section>
    );
};

export default Result;
